import "./feed.css"
import Post from "../post/Post"
import Share from "../share/Share"
import { Posts } from "../../"

export default function Feed() {
  return (
    <div className="feed">
      <div className="feedWrapper">
        <Share/>
        {Posts.map(p=>(
        
          <Post key={p.id} post={p}/>
        ))}
        
      </div>
    </div>
  )
}
